pragma solidity ^0.8.4;

contract Lottery {
 enum state {Standby,Ready,Deployed}
    string public value = "myValue";
    string[3] ListState = ["Standby","Ready","Deployed"];
    uint256 stateNum;
    mapping (address => string[]) public addr;
    address owner;
    constructor() public {
    state.Standby;
    owner = msg.sender;
    }
    modifier adminCheck() {
        require(msg.sender == owner);
        _;
    }
    function setAddr(string memory adress1, string memory adress2) public {
        addr[payable(msg.sender)].push(adress1);
        addr[payable(msg.sender)].push(adress2);
    }
    function Ready() public{
        state.Ready;
        stateNum = 1;
    }
    function Deploy() public{
        stateNum = 2;
        state.Deployed;

    }
    function isState() public view returns (string memory){
        if(stateNum == 0){
            return ListState[stateNum];
        }
            else{
                 return ListState[stateNum];
        }

    }
    function returnAddr(string memory address1 , string memory address2) public  view returns(string memory , string memory) {
        address1 = addr[payable(msg.sender)][0];
        address2 = addr[payable(msg.sender)][1];

        return(address1,address2);
    }
}
